import { useNavigate } from "react-router-dom";
import styles from "./Nav.scss"
const Nav = () => {
  const navigate = useNavigate();
  <>
    <nav className={styles.nav}>
      <div className={styles.container}></div>
    </nav>
  </>;
};
export default Nav;
